    const payload = new DeferredPayload(params);

    const cacheData = this.dataCache.get(payload.toString());
    const isUseCache = [
      CACHE_POLICY.CACHE_FIRST,
      CACHE_POLICY.CACHE_ONLY,
    ].includes(this.cachePolicy);

